  `post_id` bigint(20) unsigned NOT NULL,
  `tracker_id` bigint(20) unsigned DEFAULT NULL,
  `link` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `short_code` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `thumbnail_url` text COLLATE utf8mb4_unicode_ci,
  `type` enum('image','video','sidecar','carousel') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'image',
  `caption` text COLLATE utf8mb4_unicode_ci,
  `caption_hashtags` text COLLATE utf8mb4_unicode_ci,
  `alttext` text COLLATE utf8mb4_unicode_ci,
  `likes` int(11) DEFAULT NULL,
  `comments` int(11) DEFAULT NULL,
  `engagement_rate` double(8,2) DEFAULT NULL,
  `emojis` int(11) DEFAULT NULL,
  `comments_positive` double DEFAULT NULL,
