  `comments_emojis` json DEFAULT NULL,
  `comments_hashtags` json DEFAULT NULL,
  `video_views` int(11) DEFAULT NULL,
  `video_duration` double DEFAULT NULL,
  `location_id` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
