  `location_json` json DEFAULT NULL,
  `published_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `comments_disabled` tinyint(1) NOT NULL DEFAULT '0',
  `caption_edited` tinyint(1) NOT NULL DEFAULT '0',
  `is_ad` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `influencer_posts_uuid_unique` (`uuid`),
  KEY `influencer_posts_influencer_id_foreign` (`influencer_id`),
  KEY `influencer_posts_tracker_id_foreign` (`tracker_id`),
  CONSTRAINT `influencer_posts_influencer_id_foreign` FOREIGN KEY (`influencer_id`) REFERENCES `influencers` (`id`) ON DELETE CASCADE,
  CONSTRAINT `influencer_posts_tracker_id_foreign` FOREIGN KEY (`tracker_id`) REFERENCES `trackers` (`id`) ON DELETE SET NULL
